    <div>
      <h5>
        {props.mem.name} <Badge color="secondary">{props.mem.role}</Badge>
      </h5>
      <p>{props.mem.email}</p>
      <Button size="sm">edit</Button>
    </div>
  );
};

export default MemberCard;
